svg.script:
var lines = ["Flusso_484", "Flusso_469", "Flusso_481", "Flusso_471", "Flusso_470", "Flusso_458", "Flusso_467", "Flusso_457", "Flusso_456", "Flusso_461", "Flusso_464", "Flusso_476", "Flusso_455", "Flusso_482", "Flusso_475", "Flusso_474", "Flusso_462", "Flusso_473", "Flusso_468", "Flusso_480", "Flusso_465", "Flusso_454", "Flusso_459", "Flusso_479", "Flusso_466", "Flusso_478", "Flusso_463", "Flusso_483", "Flusso_453", "Flusso_460", "Flusso_452", "Flusso_472", "Flusso_477"];
var devices = [["a1ul5", "a1ul4"], ["a1ul1", "s-954a"], ["s-954a", "a1ul7"], ["a1ul11", "p904b"], ["s-954b", "a1ul5"], ["a1ul3", "a1ul2"], ["a1ul6", "s-954b"], ["a1ul14", "s-904d"], ["ferricostart", "s-904d"], ["p904b", "a1ul12"], ["a1ul2", "s-954b"], ["a1ul8", "a1ul9"], ["a1ul3", "a1ul1"], ["a1ul6", "a1ul4"], ["s-904e", "a1ul9"], ["s-904e", "a1ul10"], ["ferricostart", "s-904e"], ["a1ul4", "p954"], ["ferrosostart", "s-954a"], ["a1ul9", "a1ul11"], ["ferrosostart", "s-954b"], ["a1ul12", "a1ul14"], ["a1ul12", "a1ul13"], ["a1ul8", "a1ul11"], ["a1ul5", "s-954b"], ["a1ul10", "a1ul11"], ["a1ul13", "s-904e"], ["a1ul7", "a1ul4"], ["a1ul12", "rampa2"], ["p954", "a1ul3"], ["a1ul3", "rampa1"], ["s-904d", "a1ul8"], ["s-954b", "a1ul6"]];
var elementLines = [];
var elementDevices = [];
var n = [];
var nD = [];
function highlight(className, value, display) {
    document.getElementById(className.baseVal).setAttribute("display", display);
    for(var i = 0; i <  n[className.baseVal]; i ++) {
        elementLines[className.baseVal][i].setAttribute("stroke-width", value);
    }
    for(var i = 0; i < nD[className.baseVal]; i++) {
        elementDevices[className.baseVal][i].setAttribute("stroke-width", value);
    }
}
for(var i = 0; i < lines.length; i++) {
    var currentClass = lines[i];
    elementLines[currentClass] = document.getElementsByClassName(currentClass);
    n[currentClass] = elementLines[currentClass].length;
    nD[currentClass] = devices[i].length;
    elementDevices[currentClass] = [];
    for(var j = 0; j < nD[currentClass]; j++) {
        elementDevices[currentClass][j] = document.getElementById(devices[i][j]);
    }
    for(var k = 0; k < n[currentClass]; k++) {
        elementLines[currentClass][k].onmouseover = function() {
            highlight(this.className, "7", "block");
        };
        elementLines[currentClass][k].onmouseout = function() {
            highlight(this.className, "3", "none");
        };
    }
};
